import React from 'react';
import { motion } from 'framer-motion';
import { Leaf, Zap, Globe, Users, Award, TrendingUp } from 'lucide-react';
import './About.css';

const About = () => {
  const stats = [
    { icon: <Leaf size={32} />, number: "500+", label: "Solar Installations" },
    { icon: <Zap size={32} />, number: "50MW", label: "Clean Energy Generated" },
    { icon: <Globe size={32} />, number: "25,000", label: "Tons CO2 Saved" },
    { icon: <Users size={32} />, number: "1000+", label: "Happy Customers" }
  ];

  const values = [
    {
      icon: <Leaf size={24} />,
      title: "Sustainability First",
      description: "We're committed to creating a sustainable future through innovative solar energy solutions."
    },
    {
      icon: <Award size={24} />,
      title: "Quality Assurance",
      description: "Every installation meets the highest industry standards with comprehensive warranties."
    },
    {
      icon: <TrendingUp size={24} />,
      title: "Innovation Driven",
      description: "We leverage cutting-edge technology to maximize energy efficiency and savings."
    }
  ];

  return (
    <section className="about-section">
      <div className="about-container">
        <motion.div
          className="about-header"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">
            About <span className="highlight">CLEANCO Energy</span>
          </h2>
          <p className="section-subtitle">
            Leading the transition to clean, renewable energy with innovative solar solutions that power homes, businesses, and communities.
          </p>
        </motion.div>

        <div className="about-content">
          {/* Main Content */}
          <motion.div
            className="about-main"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            viewport={{ once: true }}
          >
            <div className="about-text">
              <h3>Powering a Sustainable Future</h3>
              <p>
                Founded with a vision to accelerate the world's transition to sustainable energy, 
                CLEANCO Energy has been at the forefront of solar innovation for over a decade. 
                We believe that clean energy should be accessible to everyone, and we're making 
                that vision a reality through cutting-edge technology and exceptional service.
              </p>
              <p>
                Our team of certified professionals brings together decades of experience in 
                solar installation, energy efficiency, and renewable energy systems. We work 
                closely with homeowners and businesses to design custom solar solutions that 
                maximize energy production while minimizing environmental impact.
              </p>
            </div>
            
            <div className="about-image">
              <img 
                src="https://images.unsplash.com/photo-1509391366360-2e959784a276?w=600&h=400&fit=crop" 
                alt="Solar panels installation" 
              />
            </div>
          </motion.div>

          {/* Stats */}
          <motion.div
            className="stats-grid"
            initial={{ opacity: 0, y: 50 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            viewport={{ once: true }}
          >
            {stats.map((stat, index) => (
              <motion.div
                key={index}
                className="stat-card"
                whileHover={{ scale: 1.05 }}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
                viewport={{ once: true }}
              >
                <div className="stat-icon">{stat.icon}</div>
                <div className="stat-number">{stat.number}</div>
                <div className="stat-label">{stat.label}</div>
              </motion.div>
            ))}
          </motion.div>

          {/* Values */}
          <motion.div
            className="values-section"
            initial={{ opacity: 0, y: 50 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
            viewport={{ once: true }}
          >
            <h3>Our Core Values</h3>
            <div className="values-grid">
              {values.map((value, index) => (
                <motion.div
                  key={index}
                  className="value-card"
                  whileHover={{ scale: 1.02 }}
                  initial={{ opacity: 0, y: 20 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.5, delay: index * 0.1 }}
                  viewport={{ once: true }}
                >
                  <div className="value-icon">{value.icon}</div>
                  <h4>{value.title}</h4>
                  <p>{value.description}</p>
                </motion.div>
              ))}
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
